import React from 'react';

class NavBar extends React.Component<{}, { isBoxVisible: boolean }> {
    constructor(props: Readonly<{}>){
        super(props);
        this.state = {
          isBoxVisible:false
        };
      }
    
      toggleBox = () => {
        this.setState( {isBoxVisible:!this.state.isBoxVisible});
      };


    render(){
        console.log(this.state);
        return (
            <nav className="navbar navbar-expand bg-dark navbar-dark" role = "navigation">
  <a className="navbar-brand" href="#">Navbar</a>
  <button className="navbar-toggler navbar-toggler-right indexcity" onClick={this.toggleBox} type="button">
    TOGGLE
    {/* <span className="navbar-toggler-icon"></span> */}
  </button>
  <div className={this.state.isBoxVisible ? "navbar-collapse right":"navbar-collapse"} id="collapsibleNavbar">
  <ul className="navbar-nav">
      <li className="nav-item">
        <a className="nav-link" href="#">Link</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="#">Link</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="#">Link</a>
      </li>
    </ul>
  </div>  
</nav>
        );
    }
}

export default NavBar
